import unittest
import pytest
from add_two_numbers_ii import Solution

class TestSolution(unittest.TestCase):
    def setUp(self):
        self.solution = Solution()

    def test_add_two_numbers_ii(self):
        self.assertEqual(self.solution.twoSumDict([2,7,11,15], 9), [1,2])
        self.assertEqual(self.solution.twoSumDict([2,7,11,15], 17), [1,4])
        self.assertEqual(self.solution.twoSumDict([-1,1,15,17], 0), [1,2])

        self.assertEqual(self.solution.twoSumCmp([2,7,11,15], 9), [1,2])
        self.assertEqual(self.solution.twoSumCmp([2,7,11,15], 17), [1,4])
        self.assertEqual(self.solution.twoSumCmp([-1,1,15,17], 0), [1,2])

